import {
    CHANGE_NEW_NEW_ORDER_TABLE_DATA,
    DELETE_NEW_NEW_ORDER_TABLE_DATA,
    LOAD_NEW_NEW_ORDER_TABLE_DATA,
  } from '../actions/newNewOrderTableActions';
  
  const initialState = {
    items: [
      {
        title: 'Ben Pic',
